      <div className="content">
        <p>Ofere√ßa <strong>spots</strong>  para programadores e ecntrontre <strong>talentos</strong> para sua empresa.</p>
        <form action="">
          <label htmlFor="email">E-MAIL *</label>
          <input
            type="email"
            id="email"
